import React from 'react';
import { Container, AppBar, Typography, TextField } from '@material-ui/core';
import hello from './img/hello.png';

const App = () => {
    return (

        <Container maxidth="lg">
            <h1>Application Form</h1>
            <AppBar position="static" color="inherit">
                <Typography varaint="h2" align="center"> Apply </Typography>
                <img src={hello} alt="hi" height="20" width="20"/>
            </AppBar>
            <br></br>
            <TextField id="outlined-basic" label="Nmae" variant="outlined" />
            <TextField id="outlined-basic" label="Location" variant="outlined" />
        </Container>
    )
}

export default App;
